import React from "react";  


class Music extends React.Component{
    render(){
        return(
            <div className=" screen_div music">
                <h2>Music</h2>
                <div className="songs">
                    All Songs
                </div>
                <div className="artist">
                    Artist
                </div>
                <div className="album">
                    Album
                </div>
            </div>
        )
    }
}

export default Music;
